INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10001, 1.47, 0.0, 126401, "2023/06/30 12:00:00", -470.0, "2023/09/22 14:59:59", 2002, 1, "クローチェ", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 1, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10002, 2.15, 0.0, 126401, "2023/06/30 12:00:00", -470.0, "2023/09/22 14:59:59", 2002, 2, "クローチェ", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 1, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10003, 0.0, 0.0, 126501, "2023/06/30 12:00:00", -470.0, "2023/09/22 14:59:59", 2002, 2, "ライラエル", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 1, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10004, 0.0, 0.0, 126501, "2023/06/30 12:00:00", -470.0, "2023/09/22 14:59:59", 2002, 1, "ライラエル", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 1, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10005, 0.0, 0.0, 127702, "2023/09/15 15:00:00", -470.0, "2023/12/22 14:59:59", 2002, 2, "リンド", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 2, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10006, 0.0, 0.0, 127702, "2023/09/15 15:00:00", -470.0, "2023/12/22 14:59:59", 2002, 2, "リンド", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10007, 0.0, 0.0, 127802, "2023/09/15 15:00:00", -470.0, "2023/12/22 14:59:59", 2002, 1, "ヴルム", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 2, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10008, 6.5, 0.0, 127802, "2023/09/15 15:00:00", -470.0, "2023/12/22 14:59:59", 2002, 2, "ヴルム", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 2, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10009, 0.0, 0.0, 129602, "2023/12/15 15:00:00", -470.0, "2024/03/22 14:59:59", 2002, 2, "アネモネ", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 3, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10010, 0.0, 0.0, 129602, "2023/12/15 15:00:00", -470.0, "2024/03/22 14:59:59", 2002, 2, "アネモネ", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 3, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10011, 0.0, 0.0, 129701, "2023/12/15 15:00:00", -470.0, "2024/03/22 14:59:59", 2002, 1, "ネフィ=ネラ", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 3, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10012, 6.2, 0.0, 129701, "2023/12/15 15:00:00", -470.0, "2024/03/22 14:59:59", 2002, 2, "ネフィ=ネラ", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 3, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (5, 10013, 3.1, 0.0, 130301, "2024/03/15 15:00:00", -470.0, "2024/06/22 14:59:59", 2002, 3, "カノン", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 4, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10014, 6.15, 0.0, 130301, "2024/03/15 15:00:00", -470.0, "2024/06/22 14:59:59", 2002, 3, "カノン", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 4, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10015, 0.0, 0.0, 130401, "2024/03/15 15:00:00", -470.0, "2024/06/22 14:59:59", 2002, 2, "ナーナ", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 4, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10016, 3.35, 0.0, 130401, "2024/03/15 15:00:00", -470.0, "2024/06/22 14:59:59", 2002, 2, "ナーナ", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 4, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10017, 0.0, 0.0, 130502, "2024/06/15 15:00:00", -470.0, "2024/09/22 14:59:59", 2002, 1, "ホウオウ", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 5, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10018, 3.18, 0.0, 130502, "2024/06/15 15:00:00", -470.0, "2024/09/22 14:59:59", 2002, 2, "ホウオウ", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 5, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (4, 10019, 0.0, 0.0, 130503, "2024/06/15 15:00:00", -470.0, "2024/09/22 14:59:59", 2002, 4, "ホウオウ", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 5, 3);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10020, 4.9, 0.0, 123301, "2024/06/15 15:00:00", -470.0, "2024/09/22 14:59:59", 2002, 1, "ネア", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 5, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10021, 4.8, 0.0, 123301, "2024/06/15 15:00:00", -470.0, "2024/09/22 14:59:59", 2002, 1, "ネア", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 5, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10022, 4.922, 0.0, 133301, "2024/09/15 15:00:00", -470.0, "2024/12/22 14:59:59", 2002, 3, "カリザ", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 6, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (5, 10023, 9.638, 0.0, 133301, "2024/09/15 15:00:00", -470.0, "2024/12/22 14:59:59", 2002, 3, "カリザ", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 6, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10024, 2.88, 0.0, 133401, "2024/09/15 15:00:00", -470.0, "2024/12/22 14:59:59", 2002, 1, "ミーア", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 6, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10025, 4.818, 0.0, 133401, "2024/09/15 15:00:00", -470.0, "2024/12/22 14:59:59", 2002, 5, "ミーア", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 6, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10026, 1.78, 0.0, 133002, "2024/12/15 15:00:00", -470.0, "2025/03/22 14:59:59", 2002, 2, "グレイス", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 7, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (7, 10027, 6.15, 0.0, 133002, "2024/12/15 15:00:00", -470.0, "2025/03/22 14:59:59", 2002, 1, "グレイス", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 7, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10028, 4.28, 0.0, 133102, "2024/12/15 15:00:00", -470.0, "2025/03/22 14:59:59", 2002, 6, "ヴァイオレット", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 7, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10029, 0.0, 0.0, 133102, "2024/12/15 15:00:00", -470.0, "2025/03/22 14:59:59", 2002, 1, "ヴァイオレット", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 7, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10030, 5.53, 0.0, 136902, "2025/03/15 15:00:00", -470.0, "2025/06/23 14:59:59", 2002, 2, "ルルィ", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 8, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (7, 10031, 6.05, 0.0, 136902, "2025/03/15 15:00:00", -470.0, "2025/06/23 14:59:59", 2002, 9, "ルルィ", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 8, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10032, 0.0, 0.0, 137001, "2025/03/15 15:00:00", -470.0, "2025/06/23 14:59:59", 2002, 2, "デュラン", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 8, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10033, 0.0, 0.0, 137001, "2025/03/15 15:00:00", -470.0, "2025/06/23 14:59:59", 2002, 2, "デュラン", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 8, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10034, 0.0, 0.0, 135902, "2025/06/16 15:00:00", -470.0, "2025/09/23 14:59:59", 2002, 2, "サツキ", "おう\n好きなもん持ってきな", 9, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (6, 10035, 4.935, 0.0, 135902, "2025/06/16 15:00:00", -470.0, "2025/09/23 14:59:59", 2002, 1, "サツキ", "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 9, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (5, 10036, 7.441, 0.0, 135802, "2025/06/16 15:00:00", -470.0, "2025/09/23 14:59:59", 2002, 2, "ユキノ", "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 9, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (7, 10037, 0.0, 0.0, 135802, "2025/06/16 15:00:00", -470.0, "2025/09/23 14:59:59", 2002, 7, "ユキノ", "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 9, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, 10038, 2.295, 0.0, 130901, "2025/09/16 15:00:00", -470.0, "2025/12/23 14:59:59", 2002, 2, "クルル", "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 10, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (6, 10039, 6.281, 0.0, 130901, "2025/09/16 15:00:00", -470.0, "2025/12/23 14:59:59", 2002, 1, "クルル", "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 10, 2);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, 10040, 5.549, 0.0, 137701, "2025/09/16 15:00:00", -470.0, "2025/12/23 14:59:59", 2002, 2, "ヴォルガーノ", "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 10, 1);
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (6, 10041, 2.64, 0.0, 137701, "2025/09/16 15:00:00", -470.0, "2025/12/23 14:59:59", 2002, 3, "ヴォルガーノ", "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 10, 2);
